import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <h1 class="display 1">TITULO CON BOOTSTRAP 4</h1>
        <img src={logo} className="App-logo" alt="logo" />
     
    </div>
  );
}

export default App;
